import React, { useState } from 'react';
import ReactMapGL from "react-map-gl";

export default function Map() {
  const [viewport, setViewport] = useState({
    latitude: 40.629611,
    longitude: -8.657167,
    zoom: 14,
    width: "100vw",
    height: "100vh"
  });

  return (
    <ReactMapGL
      {...viewport}
      mapboxApiAccessToken={process.env.REACT_APP_MAPBOX_TOKEN}
    >

    </ReactMapGL>
  );
}
